import { Container, Row } from "react-bootstrap"

const Login = () => {

    return (
        <Container>
            <h1>Welcome to Filmbase</h1>
            <form>
                <p>Login</p>
                <Row><input type="text" name="login"/></Row>
                <p>Password</p>
                <Row><input type="password" name="password"/></Row>
                <Row className="applyBtn"><button type="Login">Search</button></Row>
            </form>
        </Container>
    )
}

export default Login;
